        if (isset($_POST['submit'])) {
            if (isset($_FILES['xmlFiles'])) {
                echo '<div class="space-y-4">';

                foreach ($_FILES['xmlFiles']['tmp_name'] as $key => $tmp_name) {
                    if (file_exists($tmp_name)) {
                        // Load the XML file
                        $xml = simplexml_load_file($tmp_name);

                        // Register the namespace
                        $xml->registerXPathNamespace('wlan', 'http://www.microsoft.com/networking/WLAN/profile/v1');

                        // Extract SSID
                        $ssidArray = $xml->xpath('//wlan:SSID/wlan:name');
                        $ssid = isset($ssidArray[0]) ? (string)$ssidArray[0] : 'N/A';

                        // Extract passPhrase
                        $passPhraseArray = $xml->xpath('//wlan:sharedKey/wlan:keyMaterial');
                        $passPhrase = isset($passPhraseArray[0]) ? (string)$passPhraseArray[0] : 'N/A';

                        // Extract authentication type
                        $typeArray = $xml->xpath('//wlan:authEncryption/wlan:authentication');
                        $type = isset($typeArray[0]) ? (string)$typeArray[0] : 'N/A';

                        // Display the results
                        echo '<div class="bg-white p-6 rounded-lg shadow-md">';
                        echo '<h2 class="text-xl font-semibold mb-2">File: ' . htmlspecialchars($_FILES['xmlFiles']['name'][$key]) . '</h2>';
                        echo '<p><strong>SSID:</strong> ' . htmlspecialchars($ssid) . '</p>';
                        echo '<p><strong>passPhrase:</strong> ' . htmlspecialchars($passPhrase) . '</p>';
                        echo '<p><strong>Type / WPA/WPA2:</strong> ' . htmlspecialchars($type) . '</p>';
                        echo '</div>';
                    }
                }

                echo '</div>';
            }
        }
        ?>
